BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `Province` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`ARRLPrefix`	VARCHAR ( 3 ),
	`Prefix`	VARCHAR ( 7 ),
	`Comment`	VARCHAR ( 50 ),
	`Continent`	VARCHAR ( 2 ),
	`Country`	VARCHAR ( 37 ),
	`CQZone`	INTEGER,
	`DXCC`	VARCHAR ( 3 ),
	`ITUZone`	INTEGER,
	`Latitude`	VARCHAR ( 8 ),
	`Longitude`	VARCHAR ( 8 ),
	`PrefixList`	VARCHAR ( 213 ),
	`EndDate`	VARCHAR ( 19 ),
	`TimeDiff`	INTEGER,
	`StartDate`	VARCHAR ( 19 )
);
COMMIT;
